import React,{useContext} from 'react';
import BreadCrumb from '../BreadCumb'
import SearchPet from '../utils/search/SearchPet'

function Pets() {
    return (
        <>
        <BreadCrumb/>
        <div className='container'>
            <SearchPet/>
        </div>
        </>
    );
}

export default Pets;
